import { makeStyles } from '@material-ui/core/styles';

export default useStyles((theme) => ({
    root: {
        flexGrow: 1,
      },
      title: {
        flexGrow: 1,
      },
      buttons: {
        alignSelf: 'flex-end',
      },
}));
